import Navbar from "./Navbar";
import { useAuth0 } from "@auth0/auth0-react";

const ShowForm = () => {
    return (
        <>
            <form>
                <input placeholder=""></input><br/><br/>

            </form>
        </>
    );
}

function AddVendor(){
    const { isAuthenticated } = useAuth0();
    return (
        <div>
            <Navbar/>
            {
                !isAuthenticated ? <p>Please Login</p> :
                <ShowForm/>
            }
        </div>
    );
}

export default AddVendor;
